import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, AppRegistry, Animated, Easing } from 'react-native';
import { NativeRouter, Route, Link } from "react-router-native";
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Provider} from 'react-redux'
import { createStore } from 'redux';
import userProfileReducer from './src/Redux/Reducers/reducer';
import Dashboard from './src/Pages/Dashboard';
import PostForm from './src/Pages/Post';
import BroadCast from './src/Pages/Broadcast';
import PostEditor from './src/Pages/PostEditor';
import LocationForm from './src/Pages/Location/LocationForm';
import Profile from './src/Pages/Dashboard/profile';

const Stack = createNativeStackNavigator();
const store = createStore(userProfileReducer)

export default function App() {
  return (
    <Provider store={store}>
      <NavigationContainer>
        <Stack.Navigator screenOptions={{animationEnable}}>
          <Stack.Screen
              name="Dashboard"
              component={Dashboard}
              options={
                {
                  // headerShown: false,
                  header: () => <Profile />,
                }
              }
          />
          <Stack.Screen
            name="editor"
            component={PostEditor}
            options={
              {
                title: '',
                headerStyle: {
                  backgroundColor: '#0D0C13',
                  borderBottomWidth: 0,
                },
                headerTintColor: '#fff',
              }
            }
          />
          <Stack.Screen
            name="post"
            component={PostForm}
            options={
              {
                title: '',
                headerStyle: {
                  backgroundColor: '#0D0C13',
                  borderBottomWidth: 0,
                },
                headerTintColor: '#fff',
              }
            }             
          />
          <Stack.Screen
            name="broadcast"
            component={BroadCast}
            options={
              {
                title: '',
                headerStyle: {
                  backgroundColor: '#0D0C13',
                  borderBottomWidth: 0,
                },
                headerTintColor: '#fff',
                transitionSpec: {
                  duration: 750,
                  easing: Easing.out(Easing.poly(4)),
                  timing: Animated.timing,
                  useNativeDriver: true,
                },
                screenInterpolator: sceneProps => {      
                  const { layout, position, scene } = sceneProps

                  const thisSceneIndex = scene.index
                  const width = layout.initWidth

                  const translateX = position.interpolate({
                    inputRange: [thisSceneIndex - 1, thisSceneIndex],
                    outputRange: [width, 0],
                  })

                  return { transform: [ { translateX } ] }
                },
              }
            } />
          <Stack.Screen
            name="location"
            component={LocationForm}
            options={
              {
                title: '',
                headerStyle: {
                  backgroundColor: '#0D0C13',
                  borderBottomWidth: 0,
                },
                headerTintColor: '#fff',
              }
            }
          />
        </Stack.Navigator>
      </NavigationContainer>
    </Provider>
  );
}


AppRegistry.registerComponent('MyApp', () => App);
